    <p class="login-error ng-binding"></p>

    <div class="login-dialog-middle">

        <div class="login-dialog">

            <form action="" method="post" class="login-form ng-pristine ng-valid">

                <div class="logo"></div>
                <div class="version ng-binding">Guacamole 0.9.9</div>

                <!-- Login message/instructions -->
                <p ng-show="helpText" class="ng-binding ng-hide"></p>

                <!-- Login fields -->
                <div class="login-fields">
                    <div class="form-group ng-isolate-scope" namespace="'LOGIN'" content="remainingFields" model="enteredValues">
    <!-- ngRepeat: form in forms --><div ng-repeat="form in forms" class="form ng-scope">

    <span class="field-header ng-binding">Username</span>

    <!-- Field content -->
    <div class="form-field">
    <input type="text" name="username" ng-model="model" autocorrect="off" autocapitalize="off" class="ng-untouched ng-valid ng-scope ng-dirty ng-valid-parse"></div>

</label><!-- end ngRepeat: field in form.fields --><label class="labeled-field ng-isolate-scope" ng-class="{empty: !model}" ng-repeat="field in form.fields" namespace="namespace" field="field" model="values[field.name]">

    <span class="field-header ng-binding">Password</span>

    <!-- Field content -->
    <div class="form-field">
    <div class="password-field ng-scope">
    <input type="password" name="password" ng-model="model" ng-trim="false" autocorrect="off" autocapitalize="off" class="ng-untouched ng-valid ng-dirty ng-valid-parse">
    <div class="icon toggle-password" ng-click="togglePassword()" title="Click to show password"></div>
</div></div>

</label><!-- end ngRepeat: field in form.fields -->
        </div>

    </div><!-- end ngRepeat: form in forms -->
</div>
                </div>

                <!-- Submit button -->
                <div class="buttons">
                    <input type="submit" name="login" class="login" value="Login">
                    <input type="submit" name="login" class="continue-login" value="Continue">

            </form>

        </div>

    </div>

</div>
